import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div className='App'>
      <div><Header /></div>
      <ul>
        <li>HTML</li>
        <li>CSS</li>
        <li>JS</li>
        <li>React</li>
      </ul>
    </div>
  )
}
const Header = () =>{
  return (<div>
    <ul>
      <h1>Test</h1>
      <h2>Test</h2>
      <h2>Test</h2>
    </ul>
  </div>)
}
export default App;
